const lite = {
    q: [],
    n: [],
    numQ: 0,
    numN: 0,

    addQ() {
        this.q.push(0);
        this.numQ++;
    },

    addN() {
        this.n.push(0);
        this.numN++;
    },

    getQ() {
        return this.q;
    },

    getN() {
        return this.numQ;
    }

}
